Peranan Asam Klorogenat Tanaman Kopi Terhadap  Penurunan Kadar Asam Urat dan Beban Oksidatif

<jats:p>Tanaman kopi termasuk dalam golongan familia Rubiaceae, merupakan tumbuhan tropis yang tumbuh di lereng gunung. Selain mengandung  senyawa kafein,  kopi juga mengandung  polifenol yang sangat tinggi, yaitu dalam bentuk caffeoylquinic acids (CQAs), feruloylquinic acids (FQAs), dan dicaffe oylquinic acids (diCQAs) serta asam klorogenat (chlorogenic acid).  Di antara senyawa polifenol tersebut, yang paling banyak terdapat di dalam kopi adalah asam klorogenat. Kandungan asam klorogenat dalam kopi Robusta sekitar 7,0–10,0 % dan dalam biji kopi Arabika adalah 7,73 %. Senyawa ini memiliki efek farmakologi sebagai antioksidan, sehingga dapat menurunkan beban oksidatif dalam tubuh, dan memiliki kemampuan menghambat aktivitas enzim xantin oksidase, sehingga dapat menurunkan kadar asam urat dalam darah penderita hiperurisemia.&#x0D;
 </jats:p>
